package: github.com/fabric8io/kubernetes-model
import:
- package: github.com/openshift/origin
  version: ci-build-strategy
  repo: git@github.com:jimmidyson/origin.git
  vcs: git
  subpackages:
  - pkg/authorization/api/v1
  - pkg/build/api/v1
  - pkg/deploy/api/v1
  - pkg/image/api/v1
  - pkg/oauth/api/v1
  - pkg/project/api/v1
  - pkg/route/api/v1
  - pkg/template/api/v1
  - pkg/user/api/v1
- package: k8s.io/kubernetes
  version: stable-20160309
  repo: git@github.com:openshift/kubernetes.git
  vcs: git
  subpackages:
  - pkg/api/resource
  - pkg/api/unversioned
  - pkg/api/v1
  - pkg/apis/extensions/v1beta1
  - pkg/client/unversioned/clientcmd/api/v1
  - pkg/watch/json
- package: github.com/coreos/pkg
  subpackages:
  - capnslog
- package: github.com/golang/groupcache
  subpackages:
  - lru
- package: github.com/coreos/go-systemd
  subpackages:
  - journal
